import React, { Component } from "react";
import { Card, Image } from "react-bootstrap";

export default class showVideos extends Component {
  constructor(props) {
    super(props);
    this.state = {
      data: this.props,
    };
  }
  render() {
    return (
      <div>
        <Card>
          <Card.Body>
            <Image src="https://www.youtube.com/watch?v=jZ7LFwaggyI" fluid />
          </Card.Body>
        </Card>
      </div>
    );
  }
}
